class Solution:
    def lengthOfLongestSubstring(self, s: str) -> int:
        if s == "":
            return 0
        elif len(s) == 1:
            return 1
        
        highest_count = -1
        
        for i in range(0, len(s)):
            letter_dict = {}
            for j in range(i, len(s)):    
                if s[j] not in letter_dict:
                    letter_dict[s[j]] = j
                else:
                    if highest_count < len(letter_dict):
                        highest_count = len(letter_dict)
                        print(f"{j} {letter_dict}")
                    break
        
            if len(letter_dict) > highest_count:
                highest_count = len(letter_dict)   
            
        print(f"{letter_dict}\n{highest_count}")
    
        return highest_count
                

